import React from "react";

function SchemeCard({ scheme }) {
  return (
    <div style={{
      border: "1px solid #ccc",
      padding: "15px",
      marginBottom: "10px",
      borderRadius: "8px",
      backgroundColor: "#f9f9f9"
    }}>
      <p>{scheme}</p>
    </div>
  );
}

export default SchemeCard;
